import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack'; // Importa createStackNavigator
import Login from './src/components/login/Login.js'; // Corrige la ruta de importación
import { NavigationContainer } from '@react-navigation/native';

const Stack = createStackNavigator(); // Crea un stack de navegación

export default function App() {
  return (
    <NavigationContainer>
      {/* Usamos Stack.Navigator para configurar el stack de navegación */}
      <Stack.Navigator
        screenOptions={{
          headerStyle: {
            backgroundColor: 'blue', // Establece el color del header
          },
          headerTintColor: 'white', // Establece el color del texto del header
          headerTitleStyle: {
            fontWeight: 'bold', // Establece el estilo del título del header
          },
        }}
      >
        {/* Aquí agregamos las pantallas con Stack.Screen */}
        <Stack.Screen
          name="Login" // Nombre de la pantalla
          component={Login} // Componente a renderizar
          options={{
            title: 'Iniciar Sesión', // Título del header para la pantalla Login
          }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'white',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
